@avcal encouraged me to revisit some old photos and edit them again with my current style.  I have to say it was a great idea. 

This is a photo from 2014 I think. It’s so nuts to look back and realize how long I have been doing this whole photography thing. Then I remember that I turn 37 tomorrow. Holy crap. 

#visualscollective #thegreatoutdoors #ourcamplife #mountainlife #ourplanetdaily #artofvisuals #wildernessculture #beautifuldestinations #Roamtheplanet #discoverearth #stayandwander #wildernessnation #wildernesstones #earthhotspots #vsco #visualsofearth #mtb #climbing #snowshoeing #pnwonderland #backcountry #theoutbound

I have to be honest, I never was into snowshoeing. I  always opted for my splitboard and skins when it came to exploring the backcountry of the Pacific Northwest because I do love a fast decent down the mountain. Last spring, I tried snowshoeing for the first time and it definitely opened my eyes to a different way to travel in deep snow. I found the slow travel of the snowshoe allowed me to take in the epic vistas that surrounded me and invoked a level of appreciation I hadn’t had in the past. 

@backcountry has all the equipment I needed to get up the mountain and take it all in. The Tubbs VRT snowshoe had amazing review and let me tell you it didn’t disappoint. My go to outerwear is always Arcteryx with the proven track record of making some of the most versatile and reputable clothes money can buy. So get out there and explore the slow way….but its never a bad thing to take a couple laps on a splitboard as well! 

#backcountrypartner
